/* Binary algorithm needs 6*ecc->p.size + scratch for ecc_add_jja.
   Current total is 12 ecc->p.size, at most 864 bytes.

   Window algorithm needs (3<<w) * ecc->p.size for the table,
   3*ecc->p.size for a temporary point, and scratch for
   ecc_add_jjj. */

#if ECC_MUL_A_WBITS == 0
void
ecc_mul_a (const struct ecc_curve *ecc,
	   mp_limb_t *r,
	   const mp_limb_t *np, const mp_limb_t *p,
	   mp_limb_t *scratch)
{
#define tp scratch
#define pj (scratch + 3*ecc->p.size)
#define scratch_out (scratch + 6*ecc->p.size)

  int is_zero;

  unsigned i;

  ecc_a_to_j (ecc, pj, p);
  mpn_zero (r, 3*ecc->p.size);

  for (i = ecc->p.size, is_zero = 1; i-- > 0; )
    {
      mp_limb_t w = np[i];
      mp_limb_t bit;

      for (bit = (mp_limb_t) 1 << (GMP_NUMB_BITS - 1);
	   bit > 0;
	   bit >>= 1)
	{
	  int digit;

	  ecc_dup_jj (ecc, r, r, scratch_out);
	  ecc_add_jja (ecc, tp, r, pj, scratch_out);

	  digit = (w & bit) > 0;
	  /* If is_zero is set, r is the zero point,
	     and ecc_add_jja produced garbage. */
	  cnd_copy (is_zero, tp, pj, 3*ecc->p.size);
	  is_zero &= ~digit;
	  /* If we had a one-bit, use the sum. */
	  cnd_copy (digit, r, tp, 3*ecc->p.size);
	}
    }
}
#else /* ECC_MUL_A_WBITS > 1 */

#define TABLE_SIZE (1U << ECC_MUL_A_WBITS)
#define TABLE_MASK (TABLE_SIZE - 1)

#define TABLE(j) (table + (j) * 3*ecc->p.size)

static void
table_init (const struct ecc_curve *ecc,
	    mp_limb_t *table, unsigned bits,
	    const mp_limb_t *p,
	    mp_limb_t *scratch)
{
  unsigned size = 1 << bits;
  unsigned j;

  mpn_zero (TABLE(0), 3*ecc->p.size);
  ecc_a_to_j (ecc, TABLE(1), p);

  for (j = 2; j < size; j += 2)
    {
      ecc_dup_jj (ecc, TABLE(j), TABLE(j/2), scratch);
      ecc_add_jja (ecc, TABLE(j+1), TABLE(j), TABLE(1), scratch);
    }  
}

void
ecc_mul_a (const struct ecc_curve *ecc,
	   mp_limb_t *r,
	   const mp_limb_t *np, const mp_limb_t *p,
	   mp_limb_t *scratch)
{
#define tp scratch
#define table (scratch + 3*ecc->p.size)
  mp_limb_t *scratch_out = table + (3*ecc->p.size << ECC_MUL_A_WBITS);
  int is_zero = 0;

  /* Avoid the mp_bitcnt_t type for compatibility with older GMP
     versions. */
  unsigned blocks = (ecc->p.bit_size + ECC_MUL_A_WBITS - 1) / ECC_MUL_A_WBITS;
  unsigned bit_index = (blocks-1) * ECC_MUL_A_WBITS;

  mp_size_t limb_index = bit_index / GMP_NUMB_BITS;
  unsigned shift = bit_index % GMP_NUMB_BITS;
  mp_limb_t w, bits;

  table_init (ecc, table, ECC_MUL_A_WBITS, p, scratch_out);

  w = np[limb_index];
  bits = w >> shift;
  if (limb_index < ecc->p.size - 1)
    bits |= np[limb_index + 1] << (GMP_NUMB_BITS - shift);

  assert (bits < TABLE_SIZE);

  sec_tabselect (r, 3*ecc->p.size, table, TABLE_SIZE, bits);
  is_zero = (bits == 0);

  for (;;)
    {
      unsigned j;
      if (shift >= ECC_MUL_A_WBITS)
	{
	  shift -= ECC_MUL_A_WBITS;
	  bits = w >> shift;
	}
      else
	{
	  if (limb_index == 0)
	    {
	      assert (shift == 0);
	      break;
	    }
	  bits = w << (ECC_MUL_A_WBITS - shift);
	  w = np[--limb_index];
	  shift = shift + GMP_NUMB_BITS - ECC_MUL_A_WBITS;
	  bits |= w >> shift;
	}
      for (j = 0; j < ECC_MUL_A_WBITS; j++)
	ecc_dup_jj (ecc, r, r, scratch_out);

      bits &= TABLE_MASK;
      sec_tabselect (tp, 3*ecc->p.size, table, TABLE_SIZE, bits);
      cnd_copy (is_zero, r, tp, 3*ecc->p.size);
      ecc_add_jjj (ecc, tp, tp, r, scratch_out);

      /* Use the sum when valid. ecc_add_jja produced garbage if
	 is_zero != 0 or bits == 0, . */	  
      cnd_copy (bits & (is_zero - 1), r, tp, 3*ecc->p.size);
      is_zero &= (bits == 0);
    }
#undef table
#undef tp
}

#endif /* ECC_MUL_A_WBITS > 1 */

#include <stdlib.h>
#include <string.h>

static void xor_each(unsigned char * A, const unsigned char * B, const unsigned int sz) {

	const unsigned char * B_end = B + sz;

	while (B != B_end)
		*A++ ^= *B++;
}

static unsigned char * dflt_permutation(const unsigned int n, unsigned char * res,
 const unsigned char * x, const unsigned int w,
 const unsigned char * f_data, const unsigned int f_data_size) {

	unsigned int i;

	for (i = 0; i < w; ++i) {

		/* Use a different algebraic order so that our xors don't cancel. */
		res[i] = x[i] + f_data[(n + i) % f_data_size];
	}

	return res;
}

static unsigned char * turtle_(unsigned char * res,
 const unsigned char * X, const unsigned int sz,
 const unsigned int w, unsigned int * n,
 unsigned char * (*f)
  (const unsigned int, unsigned char *, const unsigned char *, const unsigned int,
                                           const unsigned char *, const unsigned int),
 const unsigned char * f_data, const unsigned int f_data_size) {

	unsigned char L[sz >> 1];
	unsigned char R[sz - sizeof(L)];

	unsigned char tmp[sizeof(R)];

	if (sz == w) {

		return f((*n)++, res, X, w, f_data, f_data_size);
	}

	memcpy(L, X            , sizeof(L));
	memcpy(R, X + sizeof(L), sizeof(R));

	xor_each(R, turtle_(tmp, L, sizeof(L), w, n, f, f_data, f_data_size), sizeof(R));
	xor_each(L, turtle_(tmp, R, sizeof(R), w, n, f, f_data, f_data_size), sizeof(L));

	xor_each(R, turtle_(tmp, L, sizeof(L), w, n, f, f_data, f_data_size), sizeof(R));
	xor_each(L, turtle_(tmp, R, sizeof(R), w, n, f, f_data, f_data_size), sizeof(L));

	memcpy(res            , L, sizeof(L));
	memcpy(res + sizeof(L), R, sizeof(R));

	return res;
}

unsigned char * turtle(unsigned char * res,
 const unsigned char * X, const unsigned int sz, const unsigned int w,
 unsigned char * (*f)(const unsigned int, unsigned char *, const unsigned char *,
                        const unsigned int, const unsigned char *, const unsigned int),
 unsigned char * f_data, const unsigned int f_data_size) {

	unsigned int n = 0;

	return turtle_(res, X, sz, w, &n, f ? f : dflt_permutation, f_data, f_data_size);
}

unsigned char * turtle_inplace(
 unsigned char * X, const unsigned int sz, const unsigned int w,
 unsigned char * (*f)(const unsigned int, unsigned char *, const unsigned char *,
                        const unsigned int, const unsigned char *, const unsigned int),
 unsigned char * f_data, const unsigned int f_data_size) {

	unsigned char tmp[sz];

   turtle(tmp, X, sz, w, f, f_data, f_data_size);

	memcpy(X, tmp, sz);

	return X;
}

